import React from "react";
import "./reports.styles.css";

export const Reports = () => {
  return (
    <div className="reports-main-container">
      <header className="reports-header">Business Reports</header>
      <div className="sales-reports-container"></div>
      <div className="bills-reports-container"></div>
      <div className="taxes-reports-container"></div>
    </div>
  );
};
